import React from "react";
import styled from "styled-components";
import MenuButtonInsta from "./MenuButtonInsta";
import MenuButtonUser from "./MenuButtonUser";
import MenuButtonGithub from "./MenuButtonGithub";
import MenuButtonJava from "./MenuButtonJava";
import {FaJava} from "react-icons/fa";
import {Icon} from 'semantic-ui-react';
import { Link } from "react-router-dom";
const Menu= styled.div`
    position:fixed;   
    display:flex;
    justify-content:space-between;
    bottom:0;
    width:560px;
    background-color:#efefef;
    height:120px;
    left:50%;
    padding:15px 30px;
    padding-bottom:10px;
    transform:translateX(-50%);
    border-top-left-radius:25px;
    border-top-right-radius:25px;

`;





class Menubar extends React.Component{
    render(){
        return <div>
            <Menu>
                <MenuButtonInsta text="Instagram" color="#3f279b"><Link to="www.naver.com"></Link></MenuButtonInsta>
                <MenuButtonGithub text="Github" color="#171515"></MenuButtonGithub>
                <MenuButtonUser text="Profile" color="#171515"></MenuButtonUser>
                <MenuButtonJava text="Java" color="#744e3b"></MenuButtonJava>
            </Menu>
            </div>
    }
}

export default Menubar;
